import React,{useCallback} from 'react';
import Particles from '@tsparticles/react';
import { loadFull } from '@tsparticles/all';
function Aa(){
    const aainit=useCallback(async(engine   )=>{
        console.log(engine); 
        await loadFull(engine);
    })
    return(
        <Particles
        id="tsparticles"
        init={aainit}
        options={{
        background: {
          color: { value: "#000000" },
        },
        particles: {
          number: { value: 80 },
          size: { value: 3 },
          color: { value: "#ffffff" },
          links: {
            enable: true,
            color: "#ffffff",
            distance: 150,
            opacity: 0.5,
            width: 1,
          },
          move: { enable: true, speed: 1 },
        },
        interactivity: {
          events: {
            onHover: { enable: true, mode: "repulse" },
            onClick: { enable: true, mode: "push" },
          },
          modes: {
            repulse: { distance: 100 },
            push: { quantity: 4 },
          },
        },
        detectRetina: true,
      }}
    />
    )
}
export default Aa;
